import { Component } from 'react';
import { Link } from 'react-router-dom';

export default class Room extends Component {
    render() {

        const { code } = this.props
        return (
            <section>
                <div className="card col" style={{ width: '18rem' ,margin:'35px'}}>
                    <img className="card-img-top" src ={process.env.PUBLIC_URL + '/images/dog.png'} style={{ width: '100%' }} alt="Card image cap" />
                    <div className="card-body">
                        <center>
                        <h5 className="card-title">{code}</h5>
                        <p className="card-text">{code}</p>

                        <a className="btn btn-primary"><Link to="/chat">Go to {code}</Link></a>
                        </center>
                    </div>
                </div>


            </section>
        )
    }
}
